import React, { Component } from 'react';
import './head.css'

class In_ul extends Component {
    render() {
        return (
            <ul>
                <li>ddd</li>
                <li>ddd</li>
                <li>ddd</li>
                <li>ddd</li>
            </ul>)
    }
}

class LiName extends Component {
    render() {
        const li_name = [
            "РЕСИВЕРЫ",
            "VOD",
            "iT",
            "SHOW-roomы",
            "заказы",
            "EPG",
            "Каналы",
            "Баги (:"
        ]

        var li_map = li_name.map((value) => {
            return <li className="li"><a>{value}</a><In_ul /></li>
        })
        return li_map
    }
}




class Head_ul extends Component {
    render() {
        return (
            <ul>
                <LiName />
            </ul>

        )
    }
}

export default Head_ul;
